import React from 'react';
import { useSpring, animated } from 'react-spring';

const ArrowToCircle = () => {
  const [toggle, setToggle] = React.useState(false);

  const props = useSpring({
    from: { 
      width: '100px', 
      height: '10px', 
      borderRadius: '0px',
      background: 'black',
      transform: 'rotate(45deg)'
    },
    to: {
      width: toggle ? '50px' : '100px', 
      height: toggle ? '50px' : '10px', 
      borderRadius: toggle ? '50%' : '0%',
      background: toggle ? 'blue' : 'black',
      transform: toggle ? 'rotate(0deg)' : 'rotate(45deg)'
    }
  });

  return (
    <div onClick={() => setToggle(!toggle)} style={{ cursor: 'pointer', display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
      <animated.div style={props} />
    </div>
  );
};

export default ArrowToCircle;
